import {makeStyles} from '@material-ui/core/styles'


export const useStyles = makeStyles((theme) => ({
    root: {
        width: '600px',
        height: '300px',
        backgroundColor: theme.palette.primary.white,
    },
    tabsContent: {
        display: 'flex'
    }
}))
